import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import axios from 'axios';
import './App.css';

const UploadPage = () => {
  const [file, setFile] = useState(null);
  const [fileName, setFileName] = useState('파일을 선택해주세요.');
  const [result, setResult] = useState('');
  const [diagnosis, setDiagnosis] = useState('');

  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    setFile(selectedFile);
    setFileName(selectedFile ? selectedFile.name : '파일을 선택해주세요.');
  };

  const handleUpload = async () => {
    if (!file) {
      alert('파일을 선택해주세요.');
      return;
    }

    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await axios.post('/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      setDiagnosis(response.data.Diagnosis);
      const { Diagnosis, ...classProbs } = response.data;
      setResult(JSON.stringify(classProbs, null, 2));
    } catch (error) {
      console.error('업로드 오류', error);
      alert('업로드에 실패했습니다.');
    }
  };

  return (
    <div className="upload-section">
      <h1>이미지 업로드 및 진단</h1>
      <input type="file" id="fileInput" className="custom-file-input" onChange={handleFileChange} />
      <label htmlFor="fileInput" className="upload-button">이미지 선택하기</label>
      <p className="file-name">{fileName}</p>
      <button onClick={handleUpload}>진단</button>
      <div className="results-section">
        <h3>진단 결과:</h3>
        <p>{diagnosis}</p>
        <h3>분류 결과:</h3>
        <pre>{result}</pre>
      </div>
    </div>
  );
};

const SignUpPage = () => {
  const handleSignUp = () => {
    const email = document.getElementById('email').value;
    const password = document.getElementById('password').value;
    if (!email || !password) {
      alert('아이디와 비밀번호를 입력하세요.');
    } else {
      // 회원가입 처리 코드를 넣으세요.
    }
  };

  return (
    <div className="form-container sign-up-container">
      <form>
        <h1>Create Account</h1>
        <div className="social-container">
          <button className="social"><i className="fab fa-facebook-f"></i></button>
          <button className="social"><i className="fab fa-google-plus-g"></i></button>
          <button className="social"><i className="fab fa-linkedin-in"></i></button>
        </div>
        <span>or use your email for registration</span>
        <div className="infield">
          <input type="text" placeholder="Name" />
          <label></label>
        </div>
        <div className="infield">
          <input type="email" placeholder="Email" id="email" />
          <label></label>
        </div>
        <div className="infield">
          <input type="password" placeholder="Password" id="password" />
          <label></label>
        </div>
        <button type="button" onClick={handleSignUp}>Sign Up</button>
      </form>
    </div>
  );
};

const SignInPage = () => {
  const handleSignIn = () => {
    const email = document.getElementById('email').value;
    const password = document.getElementById('password').value;
    if (!email || !password) {
      alert('아이디와 비밀번호를 입력하세요.');
    } else {
      // 로그인 처리 코드를 넣으세요.
    }
  };

  return (
    <div className="form-container sign-in-container">
      <form>
        <h1>Sign in</h1>
        <div className="social-container">
          <button className="social"><i className="fab fa-facebook-f"></i></button>
          <button className="social"><i className="fab fa-google-plus-g"></i></button>
          <button className="social"><i className="fab fa-linkedin-in"></i></button>
        </div>
        <span>or use your account</span>
        <div className="infield">
          <input type="email" placeholder="Email" id="email" />
          <label></label>
        </div>
        <div className="infield">
          <input type="password" placeholder="Password" id="password" />
          <label></label>
        </div>
        <button type="button" className="forgot">Forgot your password?</button>
        <button type="button" onClick={handleSignIn}>Sign In</button>
      </form>
    </div>
  );
};

function App() {
  return (
    <Router>
      <div className="container">
        <div className="header">
          <Link to="/" className="daemonset-logo">DaemonSet</Link>
          <div className="nav-links">
            <Link to="/signin">Sign In</Link>
            <Link to="/">Sign Up</Link>
          </div>
        </div>
        <Routes>
          <Route path="/" element={<SignUpPage />} />
          <Route path="/signin" element={<SignInPage />} />
          <Route path="/upload" element={<UploadPage />} />
        </Routes>
        <div className="diagnose-button">
          <Link to="/upload" className="diagnose-link">진단하기</Link>
        </div>
      </div>
    </Router>
  );
}

export default App;
